function add(a,b){
    let sum=a+b;
    return sum;
}
function sub(a,b){
    let min=a-b;
    return min;
}
function mult(a,b){
    let mul=a*b;
    return mul;
}
function divi(a,b){
    let div=a/b;
    return div;
}

export default add;
